import Login from "./components/Login";
import { BrowserRouter, Route, Switch } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/">
          <Login />
        </Route>
      </Switch>
      <Login />
    </BrowserRouter>
  );
}

export default App;
